import React from 'react'
const informations = [
    {
        id: 1,
        date: "2020-01-12",
        qualification: "Master in Computer Engineering",
        institute: { name: "NCIT", location: "Lalitpur", university: "Pokhara University" }
    },
    {
        id: 2,
        date: "2020-01-12",
        qualification: "Bachelor in Electronics and Communication Engineering",
        institute: { name: "NCIT", location: "Lalitpur", university: "Pokhara University" }
    }
]
function Academic() {
    return (
        <div className="academic">

            <div>
                <h1>Academic</h1>
            </div>

            <div className="line"></div>

            <div className="institutes">
                {
                    informations.map(info => {
                        const { id, date, qualification, institute: { name, location, university } } = info
                        return (
                            <React.Fragment key={id}>
                                <div className="date">
                                    <strong>{date}</strong>
                                </div>
                                <div className="institute">
                                    <blockquote>
                                        {qualification}
                                    </blockquote>
                                    <pre>
                                        {name}, {location}
                                    </pre>
                                    <tt>
                                        {university}
                                    </tt>
                                </div>
                               <div style={{backgroundColor:"red", width:"100%", height:"3px"}}></div>
                            </React.Fragment>
                        )
                    })
                }

            </div>

        </div>
    )
}

export default Academic
